import GlobalHeader from './GlobalHeader'
import GlobalNav from './GlobalNav'
import "../node_modules/bootstrap/dist/css/bootstrap.min.css"

export default function GlobalLayout(props) {
    return (
        <div>
            <GlobalHeader />
            <GlobalNav />
            {props.children}
        </div>
    )
}
